import logo from './logo.svg';
import './App.css';
import Main from './components/pages/main/Main';
import 'bootstrap/dist/css/bootstrap.min.css';

import { Routes, Route } from 'react-router-dom';

function App() {
  return (
    <div className="">
        <Main />
        <h1>Heelo</h1>
        <Routes>
          <Route path="/" />
        </Routes>
    </div>
  );
}

export default App;
